INSERT INTO public."AccomodationContract" VALUES (2, 16, 49, 'Все хорошо', '2023-08-26', '2023-10-06', '2023-10-23', 'paid', 'Пламя бегать палка бок сохранять. Приличный экзамен бетонный покидать. Наступать назначить беспомощный возмутиться.', 21, 50000);
INSERT INTO public."AccomodationContract" VALUES (3, 21, 11, 'Все хорошо', '2023-07-14', '2023-08-09', '2023-08-12', 'reserved', 'Набор пространство функция район выгнать интеллектуальный серьезный бетонный. Построить анализ грудь командующий мягкий расстегнуть бочок. Терапия коричневый ученый.', 63, 50000);
INSERT INTO public."AccomodationContract" VALUES (4, 59, 35, 'Все хорошо', '2023-01-05', '2023-02-28', '2023-04-19', 'not paid', 'Посвятить горький госпожа услать скрытый прелесть более. Июнь висеть солнце набор. Металл виднеться реклама плод поколение. Изображать лететь затянуться. Низкий стакан монета.', 30, 50000);
INSERT INTO public."AccomodationContract" VALUES (6, 39, 2, 'Все хорошо', '2023-10-05', '2023-10-15', '2023-10-24', 'paid', 'Монета дорогой палата фонарик. Господь миф висеть выбирать фонарик изучить. А изучить ставить вообще карандаш. Горький триста багровый упор.', 49, 50000);
INSERT INTO public."AccomodationContract" VALUES (75, 45, 92, 'Все хорошо', '2023-01-31', '2023-09-08', '2023-10-04', 'declined', 'Мягкий палата ручей упорно дрогнуть второй желание. Рассуждение пол механический. Прежде через терапия добиться банк сынок миллиард.', 72, 50000);
INSERT INTO public."AccomodationContract" VALUES (89, 63, 56, 'Все хорошо', '2023-06-09', '2023-09-13', '2023-10-08', 'reserved', 'Радость разнообразный секунда провинция пол юный. Плод миг угроза песенка цепочка уронить. Другой при спичка пробовать упор. Горький разводить девка дремать поезд исполнять смертельный. Картинка выраженный приличный равнодушный намерение.', 18, 50000);
INSERT INTO public."AccomodationContract" VALUES (90, 8, 2, 'Все хорошо', '2023-06-21', '2023-09-02', '2023-10-03', 'reserved', 'Единый костер интернет страсть уточнить призыв. Вчера полюбить интернет солнце конструкция. Прошептать самостоятельно поймать следовательно дремать. Ярко угроза лететь академик. Трубка металл правый следовательно дремать услать полевой.', 16, 50000);
INSERT INTO public."AccomodationContract" VALUES (91, 92, 23, 'Все хорошо', '2023-04-06', '2023-05-23', '2023-08-16', 'declined', 'Подробность возможно труп пространство художественный. Другой экзамен трясти да художественный вряд стакан возможно. Труп рассуждение славный спорт. Отметить приятель куча граница плавно степь лиловый.', 13, 50000);
INSERT INTO public."AccomodationContract" VALUES (97, 32, 93, 'Все хорошо', '2023-02-22', '2023-05-05', '2023-07-13', 'declined', 'Падать банк юный похороны сынок прелесть возмутиться. Сверкать лиловый сынок салон народ очутиться. Вздрогнуть солнце вскинуть холодно потом дорогой помимо. Растеряться дружно войти обида другой отдел поставить.', 74, 50000);
INSERT INTO public."AccomodationContract" VALUES (98, 85, 21, 'Все хорошо', '2023-09-02', '2023-09-23', '2023-10-14', 'reserved', 'Виднеться пропаганда миллиард выражение полоска. Ярко пространство функция тревога трясти. Волк развернуться выразить ночь. Мягкий порог отдел избегать указанный скользить спасть. Аллея соответствие художественный князь степь. Костер зачем господь реклама вытаскивать.', 53, 50000);
INSERT INTO public."AccomodationContract" VALUES (99, 68, 52, 'Все хорошо', '2023-01-09', '2023-03-02', '2023-09-17', 'reserved', 'Господь сомнительный нож плавно стакан подземный тысяча научить. Светило витрина актриса. Пища крыса кидать стакан направо рай недостаток. Какой девка девка. Пересечь трубка точно инвалид ломать издали. Тысяча солнце тяжелый результат триста заплакать.', 63, 50000);
INSERT INTO public."AccomodationContract" VALUES (100, 4, 81, 'Все хорошо', '2023-05-09', '2023-10-09', '2023-10-10', 'paid', 'Трясти рота решение результат наткнуться поставить перебивать. Ломать недостаток тревога инструкция нож беспомощный. Хотеть эпоха недостаток гулять поговорить бровь горький. Кузнец пища академик металл конференция. Неправда перебивать дьявол при недостаток ныне бочок.', 15, 50000);
