INSERT INTO public."Facilities" VALUES (1, 'Кинотеатр в номере', 'Наслаждайтесь фильмами в комфорте вашего номера с большим экраном и домашним кинотеатром.', 5000);
INSERT INTO public."Facilities" VALUES (2, 'Джакузи', 'Расслабьтесь в собственной джакузи, доступной в вашем номере.', 3000);
INSERT INTO public."Facilities" VALUES (3, 'Минибар', 'У вас всегда будет доступ к разнообразным напиткам и закускам прямо из вашего номера.', 2000);
INSERT INTO public."Facilities" VALUES (4, 'Кровать king-size', 'Наслаждайтесь комфортом большой кровати king-size для ночного отдыха.', 1000);
INSERT INTO public."Facilities" VALUES (5, 'Личный бассейн', 'Имейте доступ к собственному бассейну прямо в вашем номере.', 14000);
INSERT INTO public."Facilities" VALUES (6, 'Wi-Fi', 'Сохраните связь с миром благодаря высокоскоростному интернету.', 1000);
INSERT INTO public."Facilities" VALUES (7, 'Спутниковое телевидение', 'Просматривайте разнообразные телеканалы на большом экране в вашем номере.', 500);
INSERT INTO public."Facilities" VALUES (8, 'Услуги консьержа', 'Наши профессиональные консьержи готовы помочь вам с заказами и экскурсиями.', 1500);
INSERT INTO public."Facilities" VALUES (9, 'Завтрак в постель', 'Наслаждайтесь утром бесплатным завтраком, доставленным прямо в ваш номер.', 2000);
INSERT INTO public."Facilities" VALUES (10, 'Собственная терраса', 'Расслабьтесь на собственной террасе с панорамным видом на горы и море.', 4500);
INSERT INTO public."Facilities" VALUES (11, 'Фитнес-зал', 'Имейте доступ к современному фитнес-залу с оборудованием для занятий спортом.', 1000);
INSERT INTO public."Facilities" VALUES (12, 'Сауна и солярий', 'Расслабьтесь в сауне или получите загар в солярии на территории отеля.', 2000);
INSERT INTO public."Facilities" VALUES (13, 'Парковка', 'Паркуйте свой автомобиль в отеле в специально выделенной зоне.', 2000);
INSERT INTO public."Facilities" VALUES (14, 'Детская игровая комната', 'Вашим детям будет чем заняться в специальной игровой комнате.', 4000);
INSERT INTO public."Facilities" VALUES (15, 'Кофемашина в номере', 'Порадуйте себя свежесваренным кофе.', 1000);
